// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract Escrow {
    address public buyer;
    address public seller;
    uint public amount;
    enum Status { Pending, Shipped, Delivered, Complete }
    Status public status;

    constructor(address _buyer, address _seller) payable {
        buyer = _buyer;
        seller = _seller;
        amount = msg.value;
        status = Status.Pending;
    }

    function markShipped() external {
        require(msg.sender == seller, "Only seller can mark shipped");
        require(status == Status.Pending, "Invalid status");
        status = Status.Shipped;
    }

    function confirmDelivery() external {
        require(msg.sender == buyer, "Only buyer can confirm delivery");
        require(status == Status.Shipped, "Product not shipped yet");
        status = Status.Delivered;
        payable(seller).transfer(amount);
        status = Status.Complete;
    }

    function getStatus() public view returns (string memory) {
        if (status == Status.Pending) return "Pending";
        if (status == Status.Shipped) return "Shipped";
        if (status == Status.Delivered) return "Delivered";
        return "Complete";
    }
}

